inclusion_criteria:
1. 18 Age ≤ age ≤75 years old;
2. ECOG performance status: 0 - 1 score;
3. Patients with malignant melanoma confirmed by pathology and/or cytology, except mucosal malignant melanoma and uveal malignant melanoma;
4. Patients who have not received anti-tumor therapy at the initial stage of treatment;
5. Patients with stage III or oligometastasis stage IV malignant melanoma confirmed by histopathology or cytology. Stage III is defined as at least one clinically accessible lymph node metastasis; oligometastasis stage IV is defined as less than 4 metastases and the site of metastasis excludes bone metastases, brain metastases, or other metastases that cannot be completely surgically treated;
6. Complete surgical resection within 13 weeks prior to enrollment;
7. Laboratory tests are required to meet:

   1. Blood routine examination: hemoglobin (Hb) ≥90g/L (no blood transfusion within 14 days); Absolute neutrophil count (NEUT) ≥1.5×109/L; Platelet (PLT) ≥100×109/L;
   2. Biochemical examination: alanine aminotransferase (ALT) and aspartate aminotransferase (AST) ≤ 2.5×ULN; Serum total bilirubin (TBIL) ≤1.5×ULN; Serum creatinine (Cr) ≤1.5×ULN and creatinine clearance 50μmol/L;
   3. Coagulation function: activated partial thromboplastin time (APTT), international normalized ratio (INR), prothrombin time (PT) ≤1.5×ULN;
   4. Doppler ultrasound assessment: left ventricular ejection fraction (LVEF)≥50%;
8. Women should agree that they must use contraception (e.g., intrauterine device \[IUD\], birth control pills, or condoms) during the study and for 6 months after the end of the study; A negative serum or urine pregnancy test within 7 days prior to study enrollment and must be non-lactating; Men should agree to use contraception during the study and for 6 months after the end of the study period;
9. Patients voluntarily joined the study, signed informed consent, and had good compliance and were able to be followed up by the trial staff.

