5. Previous failure of anthracycline-containing chemotherapy was defined as disease progression during treatment or within 3 months after the last treatment, or disease progression during adjuvant treatment with anthracycline-containing chemotherapy or within 6 months after adjuvant treatment, and toxic side effects of anthracycline-containing chemotherapy were not tolerated. (Neoadjuvant or adjuvant chemotherapy is allowed in the early stage. If disease progression/recurrence occurs during neoadjuvant/adjuvant therapy or within 6 months after the end of treatment, neoadjuvant/adjuvant therapy is considered a failure of first-line systemic chemotherapy for progressive disease);
6. Patients with previous anti-angiogenic efficacy and failure were defined as: tumor progression occurred in SD or above patients after withdrawal of SD (CR/PR) during the course of anti-angiogenic therapy (including anti-angiogenic small molecule inhibitors or monoclonal antibodies), or tumor progression occurred in SD patients over 12 weeks; Or the toxic side effects of treatment are intolerable.
7. ECOG physical status 0 or 1 points (PS0-2 points for amputees);
8. Expected survival ≥12 weeks;
9. Blood test (without blood transfusion within 14 days)

1) Neutrophil absolute value ≥1.5×10\^9/L, platelets ≥100×10\^9/L, hemoglobin concentration ≥9g/dL);

2) Liver function test (aspartate aminotransferase and glutamic aminotransferase ≤2.5×ULN, total bilirubin ≤1.5×ULN; In case of liver metastasis, AST and ALT≤5×ULN);

3) Renal function (serum creatinine ≤1.5×ULN, creatinine clearance (CCr)≥60ml/min)

10. Fertile male or female patients voluntarily used effective contraceptive methods, such as double barrier methods, condoms, oral or injectable contraceptives, intrauterine devices, etc., during the study period and within 6 months of the last study dose. All female patients will be considered fertile unless they have undergone natural menopause, artificial menopause, or sterilization (such as hysterectomy, bilateral adnexectomy, or irradiation of radioactive ovaries).

