inclusion_criteria:
1. Histologically or cytologically confirmed Stage IV pancreatic ductal adenocarcinoma.
2. The expected survival time is \>3 months;
3. Patients meet the standard treatment of gemcitabine - based first-line combination therapy recommended by the 2022 edition of the NCCN Pancreatic Cancer Guidelines;
4. Age above 18 years old and ≤75 years old;
5. ECOG physical state score 0-1;
6. Patients own adequate organ and bone marrow function, defined as neutrophils ≥1,500/ul, hemoglobin ≥ 8.0gm /dL, platelets ≥80,000/uL, serum creatinine \< 2.0 mg/dL, bilirubin \< 1.5 mg/dL, alanine aminotransferase \< 3 times the upper limit of normal; If obstructive jaundice was allowed to enter the study after desicrin treatment, liver function markers were moderately relaxed to bilirubin \< 2.5 mg/dL and alanine aminotransferase \< 5 times the upper limit of normal.
7. Patients must have measurable lesions that meet the RECIST1.1 evaluation criteria. Bone scan abnormalities alone or osteolytic changes shown on plain radiographs cannot be measurable lesions, but can be evaluated in conjunction with bone scan abnormalities. Simple osteogenic bone metastases, pleural or peritoneal exudation, and radiation injury could not be considered as measurable lesions.
8. Patients who have not received "Qingyi Huayji Optimized formula " before (patients who have taken medicine for less than 2 weeks can be included at the discretion of the researchers) and who have received other traditional Chinese medicine treatment before must stop taking medicine 1 week before this study.
9. Female subjects of reproductive age must undergo a negative pregnancy test within 2 weeks prior to study drug initiation and be willing to use a medically approved highly effective contraceptive (e.g., intrauterine device, contraceptive or condom) during the study period and within 3 months after the last study drug administration; Male subjects with partners of women of reproductive age should agree to use effective contraceptive methods during the study period and within 3 months after the last study administration;
10. Patients is expected to possess good compliance, can understand and sign written informed consent, and willing to cooperate with the collection of TCM syndrome information;
11. SIRI value ≥0.8; SIRI = N × M/L, N, M, and L represent peripheral blood neutrophil, monocyte, and lymphocyte counts, respectively.

