inclusion_criteria:
1. Age ≥18 years;
2. Histology or imaging diagnosed as head and neck (oropharyngeal cancer, hypopharyngeal cancer, laryngeal cancer) squamous cell carcinoma; oropharyngeal cancer should be p16 negative (p16 positive defined as p16 ≥ 70%);
3. The radical surgery has been completed and patients were suffered from any postoperative risk factors as follows: (1) extranodal extension (ENE); (2) pT3-4; pN2-3; (3) Nerve invasion (PNI) or vascular invasion (LVI); (4) Lymph node metastasis in zone IV or zone V (oral/oropharyngeal cancer); (5) Proximal margin (\< 5mm);
4. Immunohistochemical detection indicated the EGFR expressions were positive;
5. The patients were not suitable for cisplatin chemotherapy: (1) Age\>65 years; (2) ECOG PS score\>2; (3) Renal dysfunction (creatinine clearance \<60ml/min); (4) Severe tinnitus or hearing loss (need hearing aids or hearing tests show 25 decibels threshold or above at two consecutive frequencies); (5) peripheral neuropathy severer than 1 level ; (6) Unable to accept venous hydration, such as cardiac dysfunction or other comorbidities (judged by the investigator); (7) The patient refuses cisplatin chemotherapy;
6. Imaging examination did not suggest distant metastasis;
7. Expected survival time ≥ 6 months;
8. The following criteria must be met (No transfusion of blood or blood products within 14 days prior to screening): Hb≥90g /L; ANC≥1.0×10\*9 /L; PLT≥80×10\*9 /L; white blood cell count ≥ 4×10\*9 /L; Biochemical examination need to meet the following criteria: serum total bilirubin (TBIL) ≤1.5 ULN; aminotransferase (AST)/alanine aminotransferase (ALT) ≤2.5 ULN.
9. For females of reproductive age, the patients must have a negative pregnancy test (serum or urine) within 14 days prior to enrollment and be willing to use a reliable method of contraception during the trial. Male subjects should use a reliable method of contraception from the beginning of treatment until 120 days after the last medication;
10. The subjects voluntarily joined the study and signed the informed consent, with good compliance and follow-up.

