inclusion_criteria:
* Patients voluntarily join this study and sign the informed consent form;
* Age: women aged 18 to 70 years;
* Cohort 1 patients need to meet: radical surgery in our hospital or other hospital, no gross residual lesions or imaging metastases; and our hospital surgical histopathology (or pathology consultation in our hospital) confirmed as patients with primary genital tract melanoma (vulva, vagina, cervix or uterine body origin); for vulvar malignant melanoma: postoperative pathology suggests tumor breslow thickness ≥ 1.5 mm or lymph node metastasis, in line with any of the above can be enrolled; for vaginal malignant melanoma: postoperative pathology suggests tumor diameter \> 3 cm, depth of invasion ≥ 1/2 or tumor breslow thickness ≥ 2 mm, lymph node metastasis, in line with any of the above can be enrolled; for cervical or uterine body malignant melanoma: all patients after radical surgery can be enrolled. Cohort 2 patients should meet: patients with primary female genital tract melanoma confirmed by histopathology (or pathology consultation in our hospital), who are recurrent metastatic disease or unresectable after initial treatment, and have at least one measurable lesion (RECIST version 1.1);
* If the investigator considers that the scope of surgery is too large, patients can be considered for neoadjuvant anti-PD-1 antibody therapy (no more than 4 cycles) + interval surgery + postoperative adjuvant anti-PD-1 antibody therapy: patients receiving neoadjuvant therapy must receive interval surgery after 3-4 cycles of treatment. Confirmation of pathological diagnosis using mandatory biopsy tissue samples (e.g. obtained by hollow core needle, biopsy, excision, etc.);
* 5-10 formalin-fixed, paraffin-embedded tumor tissue sections from lesions that can be obtained (not required) for biomarker analysis;
* ECOG-PS score: 0-1;
* Expected survival time ≥ 12 weeks;
* Bone marrow function: neutrophils ≥ 1.5 × 109/L, platelets ≥ 100 × 109/L, hemoglobin ≥ 90 g/L;
* Liver and kidney function: serum creatinine ≤ 1.5 times the upper limit of normal; AST and ALT ≤ 2.5 times the upper limit of normal or the presence of liver metastasis ≤ 5 times the upper limit of normal; total bilirubin ≤ 1.5 times the upper limit of normal, or patients with Gilbert's syndrome ≤ 2.5 times the upper limit of normal;
* Non-surgically sterilized subjects of childbearing age must agree to take effective contraceptive measures during the study treatment and within 3 months after the end of the study treatment period; Non-surgically sterilized women of childbearing age must have a negative serum or urine pregnancy test before the study;
* Non-lactating patients.

