inclusion_criteria:
1. Ages 18-75 (including 18 and 75), regardless of gender;
2. ECOG score ≤1;
3. Patients with colorectal adenocarcinoma/mucinous adenocarcinoma/signet ring cell carcinoma/mucinous tumor confirmed by histopathology;
