inclusion_criteria:
1. Male or non-pregnant female between the ages of 18 and 70;
2. signed informed consent;
3. The researchers believe that patients have the ability to comply with the research program;
4. hepatocellular carcinoma (HCC) by histological or cytological or clinical diagnosis;
5. imaging examination confirmed extrahepatic dissemination, including at least one evaluable (according to the criteria of RECIST1.1) extrahepatic metastasis;
6. disease is not suitable for radical surgery;
7. Patients who have not received radiotherapy or treatment with aletirizumab and/or bevacizumab;
8. Early treatment allows tyrosine kinase inhibitors (TKI) treatment or immunotherapy;
9. Pre-treatment tumor tissue samples (if available); If tumor tissue is available, submit 1 formalin-fixed, paraffin embedded (FFPE) tumor sample from a paraffin block (preferred) or approximately 10-15 slides containing unstained, off-the-shelf, serial sections together with a pathology report within 4 weeks of enrollment. If the FFPE samples described above are not available, samples of any type (including fine needle aspiration biopsy samples, cell mass samples \[e.g., samples from pleural effusion\], and irrigation samples) may also be accepted. A relevant pathology report shall be provided with the sample. If tumor tissue is not available (e.g., exhausted for previous diagnostic tests), the patient remains eligible to participate;
10. ECOG performance status of 0 or 1 within 14 days before enrollment;
11. Child-Pugh A or ≤ 7 grade B within 14 days before enrollment;
12. sufficient hematology and organ function, based on the results of the following laboratory tests obtained within 14 days before enrollment (unless otherwise specified): absolute neutropcount (ANC) ≥ 1.5 × 109/L (1500/μL), without granulocyte colony-stimulating factor support; lymphocyte count ≥ 0.5 × 109/L (500/μL); platelet count ≥ 75 × 109/L (75, 000/μL) or ≥ 60 × 109/L (60, 000/μL) but normal prothrombin time without blood transfusion; hemoglobin ≥ 90 g/L (9 g/dL), in order to meet this criterion, Patients may be allowed to have blood transfusions; AST, ALT and alkaline phosphatase (ALT) ≤ 5 times the upper limit of the normal value; Serum bilirubin ≤ 3 times the upper limit of the normal value; Serum creatinine ≤ 1.5 times the upper limit of normal value or calculated creatinine clearance ≥ 50 mL/min (calculated using Cockcroft-Gault formula); Serum albumin ≥ 28 g/L (2.8 g/dL) Urine cellulose strip test results in proteinuria \< 2 + (performed within 14 days prior to starting study treatment); patients with baseline cellulose strip test results of ≥ 2 + proteinuria should collect 24 hours of urine and then must demonstrate \< 1g of urine protein in 24 hours.
13. Any acute, clinically significant treatment-related toxicity (caused by previous treatment) must have been alleviated to ≤ 1 grade before entering the study, except hair loss;
14. HIV antibody test results were negative at the time of screening;
15. Patients with active hepatitis B virus (HBV) infection: HBV DNA \< 2000 IU/mL obtained within 28 days before the start of study treatment, and at least 7 days of anti-HBV treatment (according to the local standard treatment, such as entecavir) before the study and willing to continue treatment during the study
16. Women of childbearing age must have a negative pregnancy test (beta HCG) before starting treatment, women and men of reproductive age (having sex with women of reproductive age) must agree to use effective contraceptive measures during treatment and 6 months after the last dose of treatment.

