4. Eastern Cooperative Oncology Group (ECOG) physical condition score (PS) 0 \~ 2;
5. Expected survival of more than 3 months;
6. Within 7 days before screening (including 7 days), laboratory test data requirements were as follows: neutrophil count ≥1.5×109/L, platelet count ≥100×109/L, hemoglobin ≥90g/L (no blood transfusion within 14 days), serum total bilirubin ≤1.25 times the upper normal limit (ULN);ALT and AST≤ 2.5 x ULN (≤5x ULN in patients with liver metastasis);Serum creatinine ≤1.0 x ULN and creatinine clearance rate ≥60 mL /min;Left ventricular ejection fraction in ultrasound examination \&gt;55%;
7. At least one measurable lesion (RECIST 1.1 criteria);
8. Subjects (or their legal representative/guardian) must sign the informed consent indicating that they understand the purpose of the study, understand the necessary procedures of the study, and are willing to participate in the study.

