* Imaging confirms that there are measurable metastases in the liver or lung, which are evaluated as NED acceptable by MDT discussion;
* no previous treatment;
* Patients have adequate organ function;
* No contraindications to surgery or chemoradiation;
* The relevant test results within 7 days before the first dose must meet the following requirements:

  1. Blood routine examination (no blood transfusion within 7 days before screening, no correction with hematopoietic stimulating factor drugs):

     * Hb≥90g/L
     * ANC≥1.5×10\^9/L; LC≥0.5×10\^9/L;
     * PLT≥100×10\^9/L;
     * WBC≥3.0×10\^9/L, ≤15×10\^9/L;
  2. Blood chemistry (no blood transfusion or albumin within 7 days prior to screening):

     * ALT, AST≤1.5 ULN;
     * ALP≤2.5 ULN;
     * TBIL≤1.5 ULN;
     * Cr≤1.5 ULN, CrCL≥50 mL/min;
     * PT, APTT≤1.5 ULN, INR≤1.5 ULN(not receiving anticoagulation);
  3. TSH is within the normal range; if TSH is out of the normal range, FT3 and FT4 should be investigated. If the test results of FT3/FT4 cannot be obtained, T3 and T4 can be accepted. If the level of T3/T4 is normal, the patients can be selected.
  4. Urine test: urine protein\<2+; if the urine protein≥2+, the 24-hour urine protein quantification must be≤1g;
  5. Echocardiography: LVEF≥55%;
  6. 12-lead ECG: Fridericia corrected QTcF\<470 msec.
* Expected survival time \>6 months;
* The gene status of KRAS, NRAS, BRAF and HER2 is clear;
* Patients with microsatellite stability or mismatch repair protein defects;
* Patients are willing and able to follow the protocol during the study, including receiving treatment and scheduled follow-up and examination.

