inclusion_criteria:
1. Women aged ≥18 years and ≤70 years;
2. Histologically confirmed HR+/HER2- invasive breast cancer (defined by immunohistochemical detection of ER \&gt; 10% positive tumor cells were defined as ER positive, PR \&gt; 10% positive tumor cells were defined as positive PR, and ER and/or PR were defined as positive HR. HER2 0-1+ or HER2 ++ but negative by FISH test, no amplification, defined as HER2 negative);
3. Definition of SNF4 subtype: SNF4 subtype confirmed by digital pathology of H\&E sections;
4. High-risk early breast cancer, which was pathologically confirmed as HR+/HER2- and SNF4 subtypes; pT2-4N0-3M0;
5. Complete the adjuvant chemotherapy selected by the doctor;
6. No more than 16 months from surgery to randomization, and no more than 12 weeks after non-endocrine therapy;
7. The functions of major organs are basically normal, meeting the following conditions:

   1. The standard of blood routine examination shall meet: HB ≥90 g/L (no blood transfusion within 14 days); ANC ≥1.5×109 /L; PLT ≥75×109 /L;
   2. Biochemical examination shall meet the following standards: TBIL ≤1.5×ULN (upper limit of normal value); ALT and AST ≤3 x ULN; In case of liver metastasis, ALT and AST≤ 5×ULN; Serum Cr ≤1×ULN, endogenous creatinine clearance \> 50 ml/min (Cockcroft-Gault formula);
8. ECOG score 0 or 1;
9. Fertile female subjects are required to use a medically approved contraceptive for the duration of the study treatment and for at least 3 months after the last use of the study drug; The subjects voluntarily joined the study, signed the informed consent, had good compliance, and cooperated with follow-up.

